	public static double[][] load(String path) {
		List<String> lines = FileUtil.loadFrom(path);
		double[][] g = new double[lines.size()][];
		int j = 0;
		for (String s : lines) {
			String[] split = s.replaceAll(",", "").split(" ");
			g[j] = new double[split.length];
			for (int i=0; i<split.length; i++) g[j][i] = Double.valueOf(split[i]);
			j++;
		}
		return g;
		
	}
	public static float[] toFloat(double[] vals) {
		if (vals == null) return null;
		float[] result = new float[vals.length];
		for (int i=0; i<vals.length; i++) result[i] = (float) vals[i];
		return result;
	}
